import { Link } from "react-router-dom";
import './BIView.css';

import TicketCustomer from "./components/TicketCustomer";
import Loyalty from "./components/Loyalty";

const BI = () => {

    return (
        <>
            <div className="bi-page-container">
                <div className="header">
                    <h1>Business Intelligence Dashboard</h1>
                </div>
            <div className="bi">
                <p>For the business intelligence dashboard, please click here: </p>
                <Link to="/BIDashboard">
                    <button type="button" onClick>Park Operations Dashboard</button>
                </Link>
            </div>
            <TicketCustomer />
            <Loyalty />
            </div>
        </>
    );
};

export default BI;
